import axios from "axios";
import { useEffect, useState } from "react";
import { storageToken } from "src/contexts/authContext";
import styles from "./Summary.module.scss";

interface CardProps {
   pokemonId?: number;
   pokemonName?: string;
   pokemonImage?: string;
   baseExperience?: number;
   btcCurrencyAtAcquisition?: number;
   tradeValueAtOperationDate?: number;
   transactionId?: string;
   acquisitionUSDValue?: number;
   acquisitionDate?: Date;

   sellDate?: Date;
   sellUSDValue?: number;
}

function SummaryItem({
   pokemonId,
   pokemonName,
   tradeValueAtOperationDate,
   transactionId,
   acquisitionUSDValue,
   acquisitionDate,
   baseExperience,
   btcCurrencyAtAcquisition,
   sellUSDValue,
   sellDate,
}: CardProps) {
   const acquisitionDateString = new Date(
      acquisitionDate || ""
   ).toLocaleDateString();
   return (
      <div className={styles.summaryContainer}>
         <span className={styles.summaryTitle}>
            <p>Pokemon: {pokemonName}</p>
            <p>Id da transação: {transactionId}</p>
            <p>Valor da compra em dólares: {acquisitionUSDValue}</p>
            <p>Data da aquisição: {acquisitionDate}</p>
            <p>Tipo da transação: {sellDate ? "Venda" : "Compra"}</p>
         </span>
      </div>
   );
}

export default SummaryItem;
